deck_description:
Extra deck is where the magic is, as long as you keep halqifibrax and mecha pahntom beast Auroradon, you can make deck into lock down or whatever playstyle u desire by adding different synchro monsters or xyz. <strong>I will upload a competitive/ Lockdown version of this deck somewhere around this week on my Youtube channel @ </strong>1AndAbove.

